import React from 'react';
import Navbar from "./components/Navbar";
import './App.css';
import HomeBody from "./components/HomeBody";

function App() {
  return (
    <div className="App">
      <Navbar />
      <HomeBody className="homepage"/>
    </div>
  );
}

export default App;
